export function openPDFOrder(doc){
    window.event.preventDefault()
    pdfMake.createPdf(doc).open();
}

export function printPDFOrder(doc){
    window.event.preventDefault()
    pdfMake.createPdf(doc).print();
}

export function downloadPDFOrder(doc){
    window.event.preventDefault()
    pdfMake.createPdf(doc).download('orden-analisis.pdf');
}
